import { useFetch } from '../hooks/useFetch'

const Blog = () => {

    const { data, error, loading } = useFetch('https://jsonplaceholder.typicode.com/posts')

    if(loading){
        return <h2>loading...</h2>
    }

    if(error !== '')

    return (
        <div>
            <h1>Blog</h1>
        </div>
    )
}

export default Blog
